package domain;public class tickets {    private Integer id;    private double tickets_price;    private String seat_type;    private String train;    private Integer rest_tickets;    private String depart_time;    private String depart_station;    private String arrive_station;    private Integer tickets_orderd;    public tickets(double tickets_price, String seat_type, String train, Integer rest_tickets,                   String depart_time, String depart_station, String arrive_station, Integer tickets_orderd) {        this.tickets_price = tickets_price;        this.seat_type = seat_type;        this.train = train;        this.rest_tickets = rest_tickets;        this.depart_time = depart_time;        this.depart_station = depart_station;        this.arrive_station = arrive_station;        this.tickets_orderd = tickets_orderd;    }    public void setTickets_price(double tickets_price) {        this.tickets_price = tickets_price;    }    public void setDepart_station(String depart_station) {        this.depart_station = depart_station;    }    public void setTickets_orderd(Integer tickets_orderd) {        this.tickets_orderd = tickets_orderd;    }    @Override    public String toString() {        return "tickets{" +                "id=" + id +                ", tickets_price=" + tickets_price +                ", seat_type='" + seat_type + '\'' +                ", train='" + train + '\'' +                ", rest_tickets=" + rest_tickets +                ", depart_time='" + depart_time + '\'' +                ", depart_station='" + depart_station + '\'' +                ", arrive_station='" + arrive_station + '\'' +                ", tickets_orderd=" + tickets_orderd +                '}';    }    public tickets() {    }    public Integer getId() {        return id;    }    public String getDepart_station() {        return depart_station;    }    public Integer getTickets_orderd() {        return tickets_orderd;    }    public void setTickets_price(Integer tickets_price) {        this.tickets_price = tickets_price;    }    public void setSeat_type(String seat_type) {        this.seat_type = seat_type;    }    public void setTrain(String train) {        this.train = train;    }    public void setRest_tickets(Integer rest_tickets) {        this.rest_tickets = rest_tickets;    }    public void setDepart_time(String depart_time) {        this.depart_time = depart_time;    }    public void setArrive_station(String arrive_station) {        this.arrive_station = arrive_station;    }    public double getTickets_price() {        return tickets_price;    }    public String getSeat_type() {        return seat_type;    }    public String getTrain() {        return train;    }    public Integer getRest_tickets() {        return rest_tickets;    }    public String getDepart_time() {        return depart_time;    }    public String getArrive_station() {        return arrive_station;    }}